import "./styles/Home.css"
import Green from "./images/green.png";

const Home = () => {
    return (
        <div>
            <div className="home-image">
                <div>
                    <img src={Green} width="100px"></img>
                </div>
            </div>
            <h1>Hola</h1>
        </div>
    );
}

export default Home;
